import {Descriptions, PageHeader, Tag} from 'antd';



//전체 post 를 가져와서 띄어주는 글 (최신순으로)
const PostTitle = ({ title, hashTag,category,createdAt }) => {


    return (
        <PageHeader
        className="site-page-header"
        title={title}
        tags = {<Tag color = "blue">{category}</Tag>}
        subTitle={hashTag}
        >

            <Descriptions label = "글쓴 날자">{createdAt}</Descriptions>
        </PageHeader>
    );
}

export default PostTitle;
